import React from 'react'
import NavigationBar from './NavigationBar';
import './AboutUs.css';

function AboutUs() {
  return (
    <div>
      <NavigationBar />
      <br />
      <h1 className="About">About Fitness Point</h1>
      <p>You now have the opportunity in Asansol to look great and feel great- all in the comfort of our new, state-of-the-art Fitness Point Gym.</p>
    </div>
  )
}

export default AboutUs
